<template>
	<view class="user_center">
		<HNavigationBar />
		<view class="user_info">
			<button v-if="!avatar && !userName" class="login_btn" @tap="getUserInfo" open-type="getUserInfo" withCredentials="true">
				快速注册/登录
			</button>
			<view class="user_info_main" v-else>
				<image :src="avatar" mode="cover" class="avatar"></image>
				<view class="user_info_name">
					<text class="username">{{ userName }}</text>
					<text class="userid">用户id: 1234567890</text>
				</view>
			</view>
		</view>
		<view class="user_menu">
			<view class="user_menu_item">
				<image src="../../static/pages/pay.png" mode="cover" class="user_menu_icon"></image>
				<navigator class="user_menu_item_nav" url="index/index?title=navigate" hover-class="navigator-hover">
					充值
					<image src="../../static/pages/next.png" mode="cover" class="next"></image>
				</navigator>
			</view>
			<view class="user_menu_item">
				<image src="../../static/pages/order.png" mode="cover" class="user_menu_icon"></image>
				<navigator class="user_menu_item_nav" url="index/index?title=navigate" hover-class="navigator-hover">
					我的订单
					<image src="../../static/pages/next.png" mode="cover" class="next"></image>
				</navigator>
			</view>
			<view class="user_menu_item">
				<image src="../../static/pages/video.png" mode="cover" class="user_menu_icon"></image>
				<navigator class="user_menu_item_nav" url="index/index?title=navigate" hover-class="navigator-hover">
					我的收藏
					<image src="../../static/pages/next.png" mode="cover" class="next"></image>
				</navigator>
			</view>
		</view>
	</view>
</template>

<script>
	import HNavigationBar from '../components/hNavigationBar'
	import { appid, secret } from '../../configs/wx.config.js'
	import { getOpenID } from '../../utils/getOpenID.js'
	export default {
		components: {
			HNavigationBar
		},
		data() {
			return {
				avatar: '',
				userName: '',
				showLoading: false
			}
		},
		methods: {
			getUserInfo () {
				const that = this
				this.showLoading = true
				uni.showLoading({
					title: '正在拉取授权...',
					mask: true,
					success: function () {
					}
				})
				// 授权，获取用户信息
				uni.getUserProfile({
					desc:'weixin',
					success: function (res) {
						console.log('授权成功')
						console.log(res)
						that.userName = res.userInfo.nickName
						that.avatar = res.userInfo.avatarUrl
						getOpenID(appid, secret, function (obj) {
							if (obj && obj.openid) {
								console.log('回调函数')
								console.log(obj.openid)
								uni.setStorageSync('openid', obj.openid);
							} else {
								console.log('未取到openid！')
							}
							if (that.showLoading) uni.hideLoading()
						})
					},
					fail: function (res) {
						console.log('授权失败')
						console.log(res)
						if (that.showLoading) uni.hideLoading()
					},
					complete: function (res) {
						if (that.showLoading) uni.hideLoading()
					}
				})
			}
		}
	}
</script>

